import React from "react";
import { useState } from "react";

const AdminLogin = () =>{
    const [loginData, setLoginData] = useState({
        username: '',
        password: ''
    })

    const setValue = (e) =>{
        setLoginData({...loginData, [e.target.name]:e.target.value});
        console.log(loginData);
    }
    return(
        <>
        <div className="container">
            <div className="row">
                <div className="col-md-2"></div>
                <div className="col-md-8 mt-5 admin-login">
                    <center><img src="./images/logo.png" alt="logo" className="align-self-center" /></center>
                    <h3>Admin Panel</h3>
                    <hr />
                    <form name="adminLogin"  method="POST" className="form">
                        <p>
                            <b>Username: </b>
                            <input type="text" className="form-control w-50" placeholder=" Enter Username" name="username" onChange={this.setValue} /> 
                         </p> 
                         <p>
                         <b>Password: </b>
                            <input type="password" className="form-control w-50" placeholder="Enter Password" name="password" onChange={this.setValue} /> 
                         </p> 
                         <p>
                            <input type="submit" className="btn-subscribe form-control w-25" name="submitLogin" value="Login" /> 
                         </p>     
                    </form>
                </div>
                <div className="col-md-2"></div>
            </div>
        </div> 
        </>
    )
}

export default AdminLogin;
